description:
Song about more than just the Titanic going down.

From the album \&quot;Remember the Wind and Rain.\&quot;

Boston folkie Jaime Brockett became an underground radio sensation with his epic ballad \&amp;#039;Legend of the U.S.S. Titanic\&amp;#039;, which updated the old Leadbelly song about how black prizefighter Jack Johnson had been denied passage on the Titanic because of his race to offer an, er, alternative explanation as to why the ocean liner sank (the captain and first mate were high from smoking hemp rope)!
